  const removeLanding = () => {
    setLandingVisible((prev) => !prev);
  };
  return <>
  <MotionConfig initial="hidden" animate="visible">
    <motion.h3
      class="whisper-text"
      variants={variants}>
        sza<br/>lati<br/>ons
      </motion.h3>
      <motion.button class="enter" variants={variants} onClick={removeLanding}>enter</motion.button>
      </MotionConfig>
    {/* {landingVisible &&
    <button class="enter" onClick={setLandingVisible(false)}>enter</button>
    } */}

  </>;
}

export default Landing;
